import React, { Component } from 'react';

class Counter extends Component {
    state = { 
        counter: 0,
        addresses:{
            street: ''
        }
     }
    render() { 
        return (
            <React.Fragment>
                <span>{this.state.counter}</span>
                <button>Increment</button>
            </React.Fragment>
        );
    }

    formatCount() {
        const { count } = this.state
        return count === 0 ? 'Zero' : count
    }
}

export default Counter;
